import React from 'react';


class FinalPage extends React.Component {
  constructor() {
    super();
    this.state = { data: [] };
  }

  componentDidMount() {
    fetch('/FinalPage')
      .then(res => res.json())
      .then(json => this.setState({ data: json }));
  }

  render(){
    if (this.state.data.length===0)
        return (<p>ops</p>);
        // console.log(this.state.data[0].symbol);
        // console.log(this.state.data[0].length);
    console.log(this.state.data);
    const SelectCoins = []
    for (var i=0; i < this.state.data[0].symbol.length; i++) {
      SelectCoins.push(<p>{this.state.data[0].symbol[i]}</p>)
    }
    // const Selection = []
    // for (var j=0; j < this.state.data[0].symbol.length; j++) {
    //   Selection.push(<p>{SelectCoins[i]["props"]["children"]}</p>)
    // }

    console.log(SelectCoins);
    // console.log(SelectCoins);
    // console.log(SelectCoins[0]["props"]["children"]);
    return(
      <div class="dropdown">
        <button type="button" class="btn btn-primary dropdown-toggle" data-toggle="dropdown">
          Dropdown button
        </button>
        <div class="dropdown-menu">
          {SelectCoins.map((item)=>{
          <a class="dropdown-item" href="#">{item.props.children}</a>
        })}}

        </div>
      </div>
      )
  }
}

export default FinalPage
